import * as React from 'react';

const renderIcon = (icon) => {};

export const ControlHostingCard = ({ icon, title, description }) => {
  return (
    <div className='w-1/2 mb-16'>
      <div className='w-85p'>
        <div>{icon}</div>
        <div className='my-2'>
          <h3
            style={{ fontFamily: 'airbnb-bold' }}
            className='text-2xl text-gray-750'>
            {title}
          </h3>
        </div>
        <div>
          <p style={{ fontFamily: 'airbnb-book' }} className='text-gray-750'>
            {description}
          </p>
        </div>
      </div>
    </div>
  );
};
